message:
O que você não vê na mídia, você vê aqui!
          👁  𝑹𝒆𝒄𝒆𝒊𝒕𝒂𝒔 𝒅𝒂 𝑽𝒐́ 𝑫𝒊𝒏𝒂
            @R_ALLIANCE 🌬🔥

Kkkkkkkk
Gente presta atenção numa coisa:
- temos 153 milhões de km2 no mundo inteiro;
- no Brasil são 8,5 milhões de km2;
- 500 m2 podem produzir 4 toneladas de alimentos por ano;
- se colocarmos TODA a população mundial dentro do Brasil, daria mais de 1000 m2 pra cada um.
- uma família com 4 pessoas teria quase 5000 m2 de área disponível.
E o mundo tá acabando?

Ah, detalhe: uma pessoa consome 1 ton. De alimentos por ano.
